def beef(g):
	g = g.split()
	g.remove('=')
	counter = 0
	for i in g:
		counter += 1
		if counter % 2 == 0:
			g.remove(g[counter - 1])
	for i in g:
		if i == '=':
			g.remove(i)
	
	return g


